import { FunctionComponent } from "react";
import { useFormik } from "formik";
import * as yup from "yup";
import { addUser } from "../services/usersServices";

interface RegisterProps {
  setUserInfo: Function;
}

const Register: FunctionComponent<RegisterProps> = ({ setUserInfo }) => {
  let formik = useFormik({
    initialValues: {
      firstName: "",
      middleName: "",
      lastName: "",
      phone: "",
      email: "",
      password: "",
      imageUrl: "",
      imageAlt: "",
      state: "",
      country: "",
      city: "",
      street: "",
      houseNumber: 0,
      zip: "",
    },
    validationSchema: yup.object({
      firstName: yup.string().min(2, "Please enter a valid name"),
      middleName: yup.string().min(2),
      lastName: yup.string().min(2, "Please enter a valid name"),
      phone: yup.string().min(6, "Please enter a valid Phone number"),
      email: yup.string().email(),
      password: yup
        .string()
        // .lease Enter your password")
        .matches(
          /^(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9]{4,})(?=.*[!@#\$%\^&\*]*-_)(?=.{8,})/,
          "Must Contain at least 8 Characters, One Uppercase, One Lowercase, at least 4 Numbers and One Special Case Character(!@#$%^&*-_*)"
        ),
      imageUrl: yup.string().url(),
      imageAlt: yup.string().min(2),
      state: yup.string(),
      country: yup.string(),
      city: yup.string(),
      street: yup.string(),
      houseNumber: yup.number(),
      zip: yup.string(),
    }),
    onSubmit({ ...values }) {
      addUser({ ...values, isAdmin: false })
        .then((res) => {
          sessionStorage.setItem(
            "userInfo",
